script: |
  super -f text -I q10456.spq | sort > q10456.out

inputs:
  - name: q10456.spq
    data: |
      SELECT - col0 AS col0, 23 * col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 + 92 + - col2 * - - col1 + col2 + - col0 BETWEEN + - col1 AND NULL;
  - name: tab1

outputs:
  - name: q10456.out
    data: |
      -51	322
      -85	115
      -91	1081
